// To access the flow that completed, use the 'flow' variable.

workflow.info('****[CMP] Subflow State - '+ flow.status);

var flowOutput = flow.output;
workflow.info('****[CMP] Subflow Output - '+ flowOutput);

// This script can be used to provide the workflows(s) to use for each sub-flow execution.  If a single workflow is
// to be used for every sub-flow then simply specify that name or ID here.  Otherwise, if separate workflows may
// be needed, then perhaps use a WorkflowCoordinator instance, which can be created or referenced here.  
//
// -- Use one of the methods below --
//
// METHOD 1:  Provide a name of a workflow
//
//      'MyWorkflow'
//
//
// METHOD 2:  Provide a sys_id of a workflow via a variable
//
//       myWorkflow;
//
//
// METHOD 3:  Create a WorkflowCoordinator with parameters for each flow to launch.  
//                     The first two sub-flows will be the AllocateServer workflow and the last will be the SetupLoadBalancer workflow
//
//
//        coordinator = new WorkflowCoordinator( {workflow:'AllocateServer'} );
//        coordinator.add( {u_serverName:'Tomcat1'} );
//        coordinator.add( {u_serverName:'Tomcat2'} );
//        coordinator.add( {u_portlist: ['8080','8081,'8082'] },  'SetupLoadBalancer' );
//
//        coordinator;         // THIS MUST BE THE LAST LINE
//
//
// METHOD 4:  Have a script include return a workflow name or ID or have it return a WorkflowCoordinator instance.
//
//         var siteType = 'BackupSite';
//         var numTomcats = 4;
//
//         SiteBuilder.build(siteType, numTomcats);     // LAST LINE!  This function returns a pre-configured WorkflowCoordinator
//                          

var json = new global.JSON();

var subflowName = workflow.inputs.subflow_name;
var subflowInput = workflow.inputs.subflow_inputs;

var subflowInputObj = json.decode(subflowInput);
subflowInputObj.u_ordercontext = workflow.inputs.ordercontext;

coordinator = new global.WorkflowCoordinator( {workflow:subflowName} );
coordinator.add(subflowInputObj);
coordinator;

